function Cell(t){this.listeners=[],this.value=null,this.init(t)}Cell.prototype.init=function(t){this.setValue(t)},Cell.prototype.setValue=function(t){return this.value=t,this.changed(),this},Cell.prototype.getValue=function(){return this.value},Cell.prototype.addListener=function(t){return this.listeners.push(t),this},Cell.prototype.changed=function(){for(var t=0;t<this.listeners.length;t++)this.listeners[t].targetChanged.call(this)};